import React from 'react';
import Logo from '../../../utils/img/rsz_logo.jpg';
import Grid from '@material-ui/core/Grid';

const Navbar = props => {
	return (
		<Grid container direction='row-reverse'>
			<Grid item xs={1} container direction='column' alignItems='flex-end' className='border'>
				<Grid item>جلب رضایت شما</Grid>
				<Grid item>مهمترین دغدغه‌ی ماست</Grid>
				<Grid item>
					<img src={Logo} alt='Logo' className='border' />
				</Grid>
			</Grid>
		</Grid>
	);
};

export default Navbar;
